let productNames = [];
let productNamesAfterSort = [];
cy.wrap(productNames).as('productsNameArray');
cy.wrap(productNamesAfterSort).as('afterSortProductsArray');
_ProductListPage.default.productsList.each(element => {
  cy.wrap(element).find(_Selectors.ProductCard.Name).invoke('text').then(text => {
    let elemName = text;
    cy.wrap(elemName).as('elemName');
  });
  cy.get('@productsNameArray').then(array => {
    cy.get('@elemName').then(val => {
      array.push(val);
    });
  });
});
_ProductListPage.default.chooseSortingOption(_Constants.SortingOptions.Name_Descending);
_ProductListPage.default.productsList.each(element => {
  cy.wrap(element).find(_Selectors.ProductCard.Name).invoke('text').then(text => {
    let elemName = text;
    cy.wrap(elemName).as('afterSortElem');
  });
  cy.get('@afterSortProductsArray').then(array => {
    cy.get('@afterSortElem').then(val => {
      array.push(val);
    });
  });
});
cy.get('@productsNameArray').then(array => {
  array.sort().reverse();
  cy.get('@afterSortProductsArray').then(afterSortArray => {
    cy.compareArrays(afterSortArray, array);
  });
});

